notes:
"Denis" (pronounced like "Denee") is the lead single taken from Blondie's album [m=3399]. In most countries, it was the first single, except for Japan, where "Kidnapper" was released first.
The song was originally recorded by [r7823716] in 1963. Blondie's version became a No. 2 hit in the UK and a No. 1 hit in the Netherlands.

In the UK, "Denis" was released as a three-track single, featuring "Contact in Red Square" on B1 and "Kung Fu Girls" on B2.
A large variety of B-sides exist across the planet:

- just "Contact In Red Square" in France, Italy and South Africa;
- just "Kung Fu Girls" in Australia and New Zealand;
- "I'm On E" in the United States and Canada;
- "No Imagination" in Japan;
- "In The Flesh" in the Netherlands and Belgium (an A-side by itself -> [m=365554] but not released as such in those countries);
- "Bermuda Triangle Blues" in Germany and Argentina.

For the 1988 remix release, see [m=326699].
